import React from 'react';
import AnimatedTextCanvas from './AnimatedText';

function App() {
  return (
    <div>
      <h1 style={{ color: 'white' }}>Hello, React!</h1>
      <AnimatedTextCanvas />
    </div>
  );
}

export default App;
